url <- read_html('https://www.colossalbet.com.au/sport/upcoming/SOCC')

url %>%
  html_elements('li') %>% 
  html_text()




sb_brasil_a <- read_html("https://www.sportsbet.com.au/betting/soccer/americas/brazilian-serie-a") %>% 
  html_elements('div.marketRow_f4jyqbz') %>% 
  #html_elements('h2,div.button') %>% 
  html_text() %>% 
  as_tibble() %>% 
  mutate(
    agency = "sportsbet",
    home = str_extract(value,"\\D+(?=\\d)"),
    away = str_extract(value,"\\D+(?=\\d\\.\\d+$)"),
    home_win = as.numeric(str_extract(value,"(\\d\\.\\d+)(?=\\D)")),
    draw = as.numeric(str_remove(str_extract(value,"(Draw)(\\d\\.\\d+)(?=\\D)"),"Draw")),
    away_win = as.numeric(str_extract(value,"(\\d\\.\\d+$)")),
    home_ratio = 1/home_win,
    draw_ratio = 1/draw,
    away_ratio = 1/away_win,
    total_ratio = home_ratio + draw_ratio + away_ratio
  ) %>% 
  select(-value)




